import groovy.json.JsonBuilder
import groovy.json.JsonSlurper
import org.apache.commons.io.IOUtils
import java.nio.charset.StandardCharsets

// Get the FlowFile from the session
def flowFile = session.get()
if (!flowFile) return

try {
    // Read the FlowFile content
    def jsonContent = ''
    session.read(flowFile) { inputStream ->
        jsonContent = IOUtils.toString(inputStream, StandardCharsets.UTF_8)
    }

    // Parse JSON
    def jsonSlurper = new JsonSlurper()
    def jsonData = jsonSlurper.parseText(jsonContent)

    // Navigate to weighted_feature_rating_unit_scale and remove empty key
    if (jsonData?.product_ranking?.features_wise?.weighted_feature_rating_unit_scale) {
        def weightedFeatureRating = jsonData.product_ranking.features_wise.weighted_feature_rating_unit_scale

        // Remove empty string key if it exists
        if (weightedFeatureRating.containsKey('')) {
            weightedFeatureRating.remove('')
        }

        // Alternative: Remove any keys that are null, empty strings, or whitespace-only
        def keysToRemove = []
        weightedFeatureRating.each { key, value ->
            if (key == null || (key instanceof String && key.trim().isEmpty())) {
                keysToRemove.add(key)
            }
        }
        keysToRemove.each { key ->
            weightedFeatureRating.remove(key)
        }
    }

    // Convert back to JSON
    def jsonBuilder = new JsonBuilder(jsonData)
    def modifiedJson = jsonBuilder.toPrettyString()

    // Write modified content back to FlowFile
    flowFile = session.write(flowFile) { outputStream ->
        outputStream.write(modifiedJson.getBytes(StandardCharsets.UTF_8))
    }

    // Transfer to success
    session.transfer(flowFile, REL_SUCCESS)

} catch (Exception e) {
    log.error('Error processing FlowFile: {}', e.getMessage(), e)
    session.transfer(flowFile, REL_FAILURE)
}
